met Liam Neeson, Dermot Mulroney en Joe Anderson

Nadat hun vliegtuig crasht, strandt een groepje medewerkers van een olieplatform in het ijskoude Alaska. Ze bevinden zich in 
het territorium van een groep wolven die hen als indringers zien. Ze zullen nu moeten vechten om te overleven om niet ten 
prooi te vallen aan de hongerige wolven.
